extern crate rppal;
extern crate ssd1322;

use self::ssd1322 as oled;
use self::rppal::gpio::{Gpio, Level, OutputPin};
use self::rppal::spi::{Bus, Mode, Segment, SlaveSelect, Spi};

use std::thread;
use std::time::Duration;
use chrono::{DateTime, Timelike, Local};

use std::iter;

pub struct Oled
{
    rst_pin: OutputPin,
    dpy: oled::Display<oled::SpiInterface<Spi, OutputPin>>
}

impl Oled {
    pub fn new(dc_pin_id: u8, rst_pin_id: u8, spi_bus: Bus, spi_ss: SlaveSelect) -> Oled
    {
        let gpio = Gpio::new().unwrap();
        let mut dc_pin = gpio.get(dc_pin_id).unwrap().into_output();
        let mut rst_pin = gpio.get(rst_pin_id).unwrap().into_output();

        let spi = Spi::new(spi_bus, spi_ss, 10_000_000, Mode::Mode0).unwrap();

        // Create the SpiInterface and Display.
        let mut dpy = oled::Display::new(
            oled::SpiInterface::new(spi, dc_pin),
            oled::PixelCoord(256, 64),
            oled::PixelCoord(112, 0),
        );

        Oled { rst_pin, dpy }
    }

    pub fn init(&mut self) {

        // Assert the display's /RESET for 10ms.
        self.rst_pin.set_low();
        thread::sleep(Duration::from_millis(100));
        self.rst_pin.set_high();
        thread::sleep(Duration::from_millis(400));

        // Initialize the display. These parameters are taken from the Newhaven datasheet for the
        // NHD-3.12-25664UCY2.
        self.dpy.init(
            oled::Config::new(
                oled::ComScanDirection::RowZeroLast,
                oled::ComLayout::Progressive,
            )
                .clock_fosc_divset(9, 1)
                .display_enhancements(true, true)
                .contrast_current(59)
                .phase_lengths(5, 14)
                .precharge_voltage(31)
                .second_precharge_period(8)
                .com_deselect_voltage(7),
        ) .unwrap();

        // clear
        {
            let mut region = self.dpy
                .region(oled::PixelCoord(0, 0), oled::PixelCoord(256, 64))
                .unwrap();
            region.draw(iter::repeat(0)).unwrap();
        }
    }

    pub fn show_time(&mut self, now: &DateTime<Local>)
    {
        let top = 0;
        let height = 64;
        let width = 40;
        let left_offset = 48;

        // hours tens
        {
            let bitmap = FONT_BITMAPS[(now.hour()/10) as usize];
            let left = left_offset+width*0;
            let mut region = self.dpy
                .region(oled::PixelCoord(left, top), oled::PixelCoord(left+width, top+height))
                .unwrap();
            region.draw(bitmap.iter().cloned()).unwrap();
        }

        // hours ones
        {
            let bitmap = FONT_BITMAPS[(now.hour()%10) as usize];
            let left = left_offset+width*1;
            let mut region = self.dpy
                .region(oled::PixelCoord(left, top), oled::PixelCoord(left+width, top+height))
                .unwrap();
            region.draw(bitmap.iter().cloned()).unwrap();
        }

        // minutes tens
        {
            let bitmap = FONT_BITMAPS[(now.minute()/10) as usize];
            let left = left_offset+width*2;
            let mut region = self.dpy
                .region(oled::PixelCoord(left, top), oled::PixelCoord(left+width, top+height))
                .unwrap();
            region.draw(bitmap.iter().cloned()).unwrap();
        }

        // minutes ones
        {
            let bitmap = FONT_BITMAPS[(now.minute()%10) as usize];
            let left = left_offset+width*3;
            let mut region = self.dpy
                .region(oled::PixelCoord(left, top), oled::PixelCoord(left+width, top+height))
                .unwrap();
            region.draw(bitmap.iter().cloned()).unwrap();
        }

    }
}
